import styled from 'styled-components';
import { Form } from 'formik';

export const Wrapper = styled.div`
  padding: 30px 30px;
`;

export const Title = styled.h1`
  margin-bottom: 25px;
`;

export const StyledForm = styled(Form)`
  border: 1px solid #212121;
`;
